export default function SetupCard({ onStart }) {
  return (
    <div className="card">
      <h2>Aptitude Quiz</h2>
      <p>Sharpen math, logic, and verbal skills. Press start to begin.</p>
      <button onClick={onStart}>Start Quiz</button>
    </div>
  );
}
